    "263500ca-b9b3-45e3-a8ea-7a9ad4e4330d": {"id":"263500ca-b9b3-45e3-a8ea-7a9ad4e4330d","project_id":14262,"key":36575572,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:41.617Z","updated_at":"2022-09-26T00:03:41.617Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eAssistance needed or not?\u003c/strong\u003e\u003c/p\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eSome cyber incidents you will be able to manage in house. \u003c/p\u003e\u003c/div\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eOnce you have resolved the incident report for information purposes to the Cyber Incident Response Services (CIRS) at \u003cstrong data-type=\"bold\"\u003eCyberSecurity@dpc.vic.gov.au\u003c/strong\u003e.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "83e88b9c-a9ae-40c7-8fb9-77a242d25f64": {"id":"83e88b9c-a9ae-40c7-8fb9-77a242d25f64","project_id":14262,"key":36575570,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:41.593Z","updated_at":"2022-09-26T00:03:41.593Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eNeed onsite\u003c/strong\u003e \u003cstrong data-type=\"bold\"\u003etechnical  assistance?  \u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eContact CIRS via  \u003cstrong data-type=\"bold\"\u003eCyberSecurity@dpc.vic.gov.au\u003c/strong\u003e or call on \u003cstrong data-type=\"bold\"\u003e1300 CSU VIC / 1300 278 842\u003c/strong\u003e.\u003c/p\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003c/div\u003e\u003cdiv style=\"text-align:left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eCIRS will help triage the incident and provide access to onsite technical response and forensic support services available to you.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
