    "26fdc3d1-c0a1-47ee-b90e-25cecf1297b1": {"id":"26fdc3d1-c0a1-47ee-b90e-25cecf1297b1","project_id":14262,"key":36575559,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:40.942Z","updated_at":"2022-09-26T00:03:40.942Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThe AusCERT Incident Management Service remotely assists your organisation to detect, interpret and respond to cyber security incidents.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eAusCERT provides proactive and reactive incident response assistance and follows well-defined protocols in order to  resolve disruptions to your systems.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eAusCERT also provides a phishing take-down service  to reduce brand damage by requesting the removal of fraudulent websites. The service puts the integrity of your brand at the forefront and acts immediately if your organisation is affected.\u003c/p\u003e"},"type":"Text"}, 
