    "916b89b5-9572-4a64-9acd-430089330319": {"id":"916b89b5-9572-4a64-9acd-430089330319","project_id":14262,"key":36574989,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:32.803Z","updated_at":"2022-09-26T00:03:32.803Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003eWhale quiz\u003c/span\u003e\u003c/strong\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eLet’s look in more depth at what whaling can look like so you can identify it and then know what you need to do about it. Have a go at these five questions.\u003c/p\u003e"},"type":"Text"}, 
    "d5c6ae00-d68a-4a7e-91c9-9666ca2f1226": {"id":"d5c6ae00-d68a-4a7e-91c9-9666ca2f1226","project_id":14262,"key":36574988,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:32.751Z","updated_at":"2022-09-26T00:03:32.751Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eUh oh!\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eRegular ICT currency reporting at executive meetings is certainly a strong way to keep these issues front of mind so that updating assets can be planned for and risks mitigated. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eExecutives and senior leaders need to own the actions from these meetings so that risks are efficiently and appropriately managed.\u003c/p\u003e"},"type":"Text"}, 
    "e6655e72-9520-474b-b59d-93ebfa058f58": {"id":"e6655e72-9520-474b-b59d-93ebfa058f58","project_id":14262,"key":36574987,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:32.686Z","updated_at":"2022-09-26T00:03:32.686Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eSpot on!\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eRegular ICT currency reporting at executive meetings is certainly a strong way to keep these issues front of mind so that updating assets can be planned for and risks mitigated. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eExecutives and senior leaders need to own the actions from these meetings so that risks are efficiently and appropriately managed.\u003c/p\u003e"},"type":"Text"}, 
    "0b067979-0218-4839-9635-24167fa8fa40": {"id":"0b067979-0218-4839-9635-24167fa8fa40","project_id":14262,"key":36574986,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:32.642Z","updated_at":"2022-09-26T00:03:32.642Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eRegularly check the internet for hardware and software expiry\u003c/p\u003e"},"type":"Text"}, 
