    "41b00a6b-38b7-46bd-a4e6-7681e077723b": {"id":"41b00a6b-38b7-46bd-a4e6-7681e077723b","project_id":14262,"key":36574984,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:32.585Z","updated_at":"2022-09-26T00:03:32.585Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eAsk your IT department to tell you when to update ICT assets\u003c/p\u003e"},"type":"Text"}, 
    "4ba7ee7c-751a-4f0d-ad8a-f380ed22d5b6": {"id":"4ba7ee7c-751a-4f0d-ad8a-f380ed22d5b6","project_id":14262,"key":36574983,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:32.564Z","updated_at":"2022-09-26T00:03:32.564Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003e2. Marina\u0026#x27;s reflection\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#282a2b\" data-type=\"color\"\u003eAfter the dust settled, and there sure was a lot of it, Marina had a chance to think more carefully about how to keep on top of the currency of her ICT assets.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#282a2b\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#282a2b\" data-type=\"color\"\u003eWhat’s the best way to ensure ICT assets do not become outdated?\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e"},"type":"Text"}, 
    "717a692d-5abb-455b-aad2-1563887c487c": {"id":"717a692d-5abb-455b-aad2-1563887c487c","project_id":14262,"key":36574982,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:32.548Z","updated_at":"2022-09-26T00:03:32.548Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003e4. Checking links\u003c/span\u003e\u003c/strong\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#282a2b\" data-type=\"color\"\u003eWith the ‘MadMountain’ email, Jen did check the full sender’s address but was unsure as it looked like the real thing. However, as the race was on her mind, she opened the email anyway as it looked important. She is still rightly suspicious about it, and is confused about what to do.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#282a2b\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWhat two actions could she take below?\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e"},"type":"Text"}, 
