    "a5156836-30fc-407c-9903-261f395fe543": {"id":"a5156836-30fc-407c-9903-261f395fe543","project_id":14262,"key":36574980,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:32.471Z","updated_at":"2022-09-26T00:03:32.471Z","props":{"content":"\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWhaling – acting on it\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eAs soon as you identify a whaling threat, you need to act. There are two main actions you can take…\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
