    "06b24a16-162b-4152-859c-8929f63e3a80": {"id":"06b24a16-162b-4152-859c-8929f63e3a80","project_id":14262,"key":36574853,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:28.328Z","updated_at":"2022-09-26T00:03:28.328Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eActually from least to most impact it would be:\u003c/strong\u003e\u003c/p\u003e\u003cul data-type=\"bulleted-list\"\u003e\u003cul data-type=\"bulleted-list\"\u003e\u003cli class=\"chameleon-li\" data-type=\"list-item\"\u003eSpam emails from a hotel booking website\u003c/li\u003e\u003cli class=\"chameleon-li\" data-type=\"list-item\"\u003eA phishing email with malicious links arrives in an employee\u0026#x27;s inbox, but not clicked\u003c/li\u003e\u003cli class=\"chameleon-li\" data-type=\"list-item\"\u003eA fake Office 365 login page is opened and credentials entered\u003c/li\u003e\u003cli class=\"chameleon-li\" data-type=\"list-item\"\u003eA malicious link is clicked and ransomware is deployed onto a network.\u003c/li\u003e\u003c/ul\u003e\u003c/ul\u003e"},"type":"Text"}, 
    "f6293cda-e6ff-4916-bfd6-923014c8921d": {"id":"f6293cda-e6ff-4916-bfd6-923014c8921d","project_id":14262,"key":36574852,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:28.288Z","updated_at":"2022-09-26T00:03:28.288Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eAusCERT coordinates a response\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThey will provide remote technical support and inform CIRS.\u003c/p\u003e"},"type":"Text"}, 
    "6875eff4-b025-4c24-9ade-f5c6e76bc9b9": {"id":"6875eff4-b025-4c24-9ade-f5c6e76bc9b9","project_id":14262,"key":36574851,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:28.278Z","updated_at":"2022-09-26T00:03:28.278Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eIf it isn\u0026#x27;t a significant cyber incident or emergency and you don’t need onsite assistance…\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eYou can self-manage your access to general remote technical assistance and forensic analysis with AusCERT.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eAusCERT services are remote only and cannot work onsite in Victoria.\u003c/p\u003e"},"type":"Text"}, 
    "15fb0fc3-f9ce-4020-971b-4efebe6a39e9": {"id":"15fb0fc3-f9ce-4020-971b-4efebe6a39e9","project_id":14262,"key":36574850,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:28.253Z","updated_at":"2022-09-26T00:03:28.253Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eIf it isn\u0026#x27;t a significant cyber incident, emergency or a data breach then do you need onsite assistance or are you not sure?\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eContact CIRS\u003c/p\u003e"},"type":"Text"}, 
    "6afd25a7-0a93-4316-810a-a6ce590c5b12": {"id":"6afd25a7-0a93-4316-810a-a6ce590c5b12","project_id":14262,"key":36574849,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:27.995Z","updated_at":"2022-09-26T00:03:27.995Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e…and is it a significant cyber incident or cyber emergency? Or does it involve a data breach?\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eReport as soon as possible to CIRS.\u003c/p\u003e"},"type":"Text"}, 
    "adebb072-61d9-47aa-a833-0d01a8999b17": {"id":"adebb072-61d9-47aa-a833-0d01a8999b17","project_id":14262,"key":36574847,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:27.954Z","updated_at":"2022-09-26T00:03:27.954Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eSelf-manage...\u003c/p\u003e"},"type":"Text"}, 
    "1d95b48f-2e4a-4c4e-a42b-50a30eac4ccb": {"id":"1d95b48f-2e4a-4c4e-a42b-50a30eac4ccb","project_id":14262,"key":36574846,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:27.932Z","updated_at":"2022-09-26T00:03:27.932Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eSelf-manage your engagement with AusCERT for all general technical and forensic assistance (including the referral of phishing emails for analysis and malicious URL takedown). AusCERT will notify CIRS of your incident for information purposes and CIRS will contact you directly if needed.\u003c/p\u003e"},"type":"Text"}, 
