    "ba3a91a5-8699-4a6e-b1cb-0520abb83384": {"id":"ba3a91a5-8699-4a6e-b1cb-0520abb83384","project_id":14262,"key":36575263,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:37.574Z","updated_at":"2022-09-26T00:03:37.574Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWhaling – identify it\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003eXin could have spotted that she was being scammed with a targeted whaling attack by checking more carefully on who sent the email.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003eOn many laptops and desktops your inbox won’t show the full sender’s address. You may only see the friendly ‘display name’ of a sender and these can look legitimate even when the address is not. Here’s one way to check the full address…\u003c/span\u003e\u003c/p\u003e"},"type":"Text"}, 
    "432a4ac5-4406-4a41-8e76-c04bbc2139cc": {"id":"432a4ac5-4406-4a41-8e76-c04bbc2139cc","project_id":14262,"key":36575262,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:37.565Z","updated_at":"2022-09-26T00:03:37.565Z","props":{"src":"images/image_219.png","imageId":219},"type":"Image"}, 
    "4cfbce6f-7ad8-43bc-a9ae-73853c6121a6": {"id":"4cfbce6f-7ad8-43bc-a9ae-73853c6121a6","project_id":14262,"key":36575261,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:37.558Z","updated_at":"2022-09-26T00:03:37.558Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#87189d\" data-type=\"color\"\u003eWhaling – identify it\u003c/span\u003e\u003c/strong\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eIf Xin checks her emails on her mobile she’ll also only likely see the display address but she can still check the full address. How she does this depends on her device, email app and settings. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eHere’s one way to check…\u003c/strong\u003e\u003c/p\u003e"},"type":"Text"}, 
