    "b606f473-04c7-4dec-8b51-aef3ffb27797": {"id":"b606f473-04c7-4dec-8b51-aef3ffb27797","project_id":14262,"key":36575256,"version":null,"meta":{"subType":"continue"},"children":null,"deleted_at":null,"created_at":"2022-09-26T00:03:37.519Z","updated_at":"2022-09-26T00:03:37.519Z","props":{"label":"Continue","background":"#00b2a9","borderWidth":1,"shape":"pill","font":"","location":"next","localBackgroundColor":true},"type":"ContinueButton"}, 
    "1abf9863-6d1e-4f36-991d-c5b18ea14095": {"id":"1abf9863-6d1e-4f36-991d-c5b18ea14095","project_id":14262,"key":36575255,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:37.512Z","updated_at":"2022-09-26T00:03:37.512Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWhaling – identify it\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003eXin had a link in her whaling email that redirected her to a fraudulent site. \u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003eWatch out for hyperlinks and ‘go to’ buttons.  If the link looks dodgy and doesn’t match the sender’s URL then beware.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003eOn laptops/desktops you can hover over buttons and links to see the actual embedded link. \u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003eOn mobile devices you can’t hover but you can press and hold a link and this will show you the real embedded address.\u003c/span\u003e\u003c/p\u003e"},"type":"Text"}, 
    "86677227-3264-4b7c-a9ce-58ddf44b8ee7": {"id":"86677227-3264-4b7c-a9ce-58ddf44b8ee7","project_id":14262,"key":36575254,"version":null,"meta":{"subType":"continue"},"children":null,"deleted_at":null,"created_at":"2022-09-26T00:03:37.505Z","updated_at":"2022-09-26T00:03:37.505Z","props":{"label":"Continue","background":"#87189d","borderWidth":1,"shape":"pill","font":"","location":"next","localBackgroundColor":true},"type":"ContinueButton"}, 
    "fc450f64-7fdb-4896-9c3c-5aa512efb7d3": {"id":"fc450f64-7fdb-4896-9c3c-5aa512efb7d3","project_id":14262,"key":36575253,"version":null,"meta":{"subType":"continue"},"children":null,"deleted_at":null,"created_at":"2022-09-26T00:03:37.497Z","updated_at":"2022-09-26T00:03:37.497Z","props":{"label":"Continue","background":"#00b2a9","borderWidth":1,"shape":"pill","font":"","location":"next","localBackgroundColor":true},"type":"ContinueButton"}, 
    "a3e69dae-9d03-4a32-b9e7-449ebd76479e": {"id":"a3e69dae-9d03-4a32-b9e7-449ebd76479e","project_id":14262,"key":36575252,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:37.489Z","updated_at":"2022-09-26T00:03:37.489Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#87189d\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWhaling – identify it\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eScammers can also cause a world of pain by getting you to open attachments to emails. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOnce opened these can introduce malware onto your system. Some examples can steal information, others can lock you out of files so that you need to pay a ransom to regain access.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOnly ever open attachments from trusted senders.\u003c/p\u003e"},"type":"Text"}, 
    "4dd15952-3020-4d49-a773-db4e429b241a": {"id":"4dd15952-3020-4d49-a773-db4e429b241a","project_id":14262,"key":36575251,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:37.478Z","updated_at":"2022-09-26T00:03:37.478Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat\u0026#x27;s right.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eJen’s free to use social media as she wants. However, she needs to watch what kind of information she’s putting out publicly. She trusts her good friends but she has accepted a few ‘friend requests’ from people she hardly knows. Some of these folks enjoy re-posting her messages to others she doesn’t know at all.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHarry, a friend of a friend of a friend, sees what she’ll be doing next week…\u003c/p\u003e"},"type":"Text"}, 
