    "a9bf1866-7a2e-435d-80c2-1983c9bae9c7": {"id":"a9bf1866-7a2e-435d-80c2-1983c9bae9c7","project_id":14262,"key":36575249,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:37.249Z","updated_at":"2022-09-26T00:03:37.249Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eNot quite.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eJen’s free to use social media as she wants. However, she needs to watch what kind of information she’s putting out publicly. She trusts her good friends but she has accepted a few ‘friend requests’ from people she hardly knows. Some of these folks enjoy re-posting her messages to others she doesn’t know at all.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHarry, a friend of a friend of a friend, sees what she’ll be doing next week…\u003c/p\u003e"},"type":"Text"}, 
    "ff552015-154b-4c22-882c-6bc1fbc545b5": {"id":"ff552015-154b-4c22-882c-6bc1fbc545b5","project_id":14262,"key":36575248,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:37.240Z","updated_at":"2022-09-26T00:03:37.240Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat\u0026#x27;s right.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOn a laptop/desktop she can check the real address by right-clicking or hovering on the display name for more information.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOn a mobile device she can also find out the full sender’s address by selecting the email and then selecting the display name to see the full address. Depending on your device and set-up there may be other ways you can check – practise on your devices after completing this.\u003c/p\u003e"},"type":"Text"}, 
