    "6e2dafd5-4b40-4d18-930f-d7188ff579a3": {"id":"6e2dafd5-4b40-4d18-930f-d7188ff579a3","project_id":14262,"key":36574793,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:25.808Z","updated_at":"2022-09-26T00:03:25.808Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat\u0026#x27;s right\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eShe should never click on a link in a suspicious email. On a laptop she could check a link by hovering over it. If she is on a mobile, she could press and hold the link to see if it looks okay. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eIf it looks like a scam then she should report it using the ‘Report Spam’ button. There’s no need to reporting to ICT security team unless she needs to escalate the incident if she did open the link.\u003c/p\u003e"},"type":"Text"}, 
    "91b6070c-244d-44ec-afd3-58e8e76cdaf1": {"id":"91b6070c-244d-44ec-afd3-58e8e76cdaf1","project_id":14262,"key":36574792,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:25.778Z","updated_at":"2022-09-26T00:03:25.778Z","props":{"src":"images/image_1368.gif","imageId":1368},"type":"Image"}, 
    "a832cc31-e4c0-4740-9d6f-13ef0b04667f": {"id":"a832cc31-e4c0-4740-9d6f-13ef0b04667f","project_id":14262,"key":36574791,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:25.718Z","updated_at":"2022-09-26T00:03:25.718Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eNot quite\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eShe should never click on a link in a suspicious email. On a laptop she could check a link by hovering over it. If she is on a mobile, she could press and hold the link to see if it looks okay. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eIf it looks like a scam then she should report it using the ‘Report Spam’ button. There’s no need to reporting to ICT security team unless she needs to escalate the incident if she did open the link.\u003c/p\u003e"},"type":"Text"}, 
    "599e7fd1-f543-4d3b-8c48-bab118b722aa": {"id":"599e7fd1-f543-4d3b-8c48-bab118b722aa","project_id":14262,"key":36574790,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:25.686Z","updated_at":"2022-09-26T00:03:25.686Z","props":{"src":"images/image_1369.gif","imageId":1369},"type":"Image"}, 
    "2ccfcb77-d9b2-41c9-ae48-544b1b9754a3": {"id":"2ccfcb77-d9b2-41c9-ae48-544b1b9754a3","project_id":14262,"key":36574789,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:25.673Z","updated_at":"2022-09-26T00:03:25.673Z","props":{"content":"\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eThink before you click\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003ch1 data-type=\"heading-one\"\u003e\u003c/h1\u003e\u003ch3 data-type=\"heading-three\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003eSo to wrap up…\u003c/span\u003e\u003c/h3\u003e\u003c/div\u003e"},"type":"Text"}, 
    "c9484370-c9e1-409f-b6ed-8db02bb28490": {"id":"c9484370-c9e1-409f-b6ed-8db02bb28490","project_id":14262,"key":36574788,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:25.652Z","updated_at":"2022-09-26T00:03:25.652Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eHowever, the link has embedded code to download spyware onto her computer. Spyware allows hackers to remotely watch and record Xin’s actions on her computer.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThe hacker can record the keystrokes for her Office 365 password. \u003c/p\u003e"},"type":"Text"}, 
