    "d20017f9-1498-4cbd-8543-b2f7839a5e08": {"id":"d20017f9-1498-4cbd-8543-b2f7839a5e08","project_id":14262,"key":36575392,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:39.175Z","updated_at":"2022-09-26T00:03:39.175Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003eKnow your ICT assets\u003c/span\u003e\u003c/strong\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003e \u003c/strong\u003e\u003c/span\u003e\u003c/strong\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThere are many kinds of ICT assets that you’ll be responsible for. Some will be unique to your organisation. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eAll should be clearly identified within your ICT asset management practices so that you can monitor their currency and plan for any business risks associated with them. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHere’s one way of slicing the ICT asset cake.…\u003c/p\u003e"},"type":"Text"}, 
    "1901bf01-e020-4efe-a9ac-255e2c3c93cf": {"id":"1901bf01-e020-4efe-a9ac-255e2c3c93cf","project_id":14262,"key":36575391,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:39.169Z","updated_at":"2022-09-26T00:03:39.169Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#87189d\" data-type=\"color\"\u003eBe aware\u003c/span\u003e\u003c/strong\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThere is no one set way criminals carry out whaling. In addition to standard phishing techniques, such as tricking users to click on fraudulent links, they may try to lure victims into false friendships or capture them in a blackmail scam.  \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eYou are potentially a ‘high-value’ target, so you must show an extra level of care. Not only in how you use IT at work, but also in what you share publicly via social media and how you use your own personal IT devices. \u003c/p\u003e"},"type":"Text"}, 
    "82e689a3-9348-4ca7-be23-78076546e0c8": {"id":"82e689a3-9348-4ca7-be23-78076546e0c8","project_id":14262,"key":36575390,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:03:39.163Z","updated_at":"2022-09-26T00:03:39.163Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eFrom here the hacker sends Xin an email from a ‘spoofed’ domain – an address that looks like it’s from her son’s club. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThe email gives her an update on fixtures for her son’s team, and she just needs to click the link in the email.\u003c/p\u003e"},"type":"Text"}, 
